[Form]
public class TMSFreightBillDetail extends FormRun
{
    WHSLoadId                   loadId;
    TMSFreightBillDetailRecId	freightBillDetailRecId;

}

public void init()
{
    switch (element.args().dataset())
    {
        case tableNum(WHSLoadTable):
            WHSLoadTable loadTable = element.args().record();
            loadId = loadTable.LoadId;
            break;

        case tableNum(TMSFreightBillDetailUnMatched):
            TMSFreightBillDetailUnMatched detailUnmatched = element.args().record();
            freightBillDetailRecId = detailUnmatched.RecId;
            break;

        case tableNum(TMSFreightBillDetail):
            TMSFreightBillDetail detailMatched = element.args().record();
            freightBillDetailRecId = detailMatched.RecId;
            break;

        case tableNum(TMSFreightBillDetailStaging):
            TMSFreightBillDetailStaging freightBillDetailStaging = element.args().record();
            freightBillDetailRecId = TMSFreightBillDetail::find(freightBillDetailStaging.FreightBillDetailEntryNumber).RecId;
            break;
    }

    super();
}

public int active()
{
    int ret = super();

    tmsInvoiceJournal.enabled(TMSFreightBillDetail::existsInvoiceJournal(tmsFreightbillDetail.RouteCode, loadId));

    return ret;
}

        public void init()
